import * as React from 'react'
import style from './User.module.css'

export default class User extends React.Component{
    state = {
        username:'',
        sex: '',
        phonenumber:''    
    }
    render(){
        return(
            <div>
                <label onClick = {this.props.setselect} className ={style.backpage}>返回</label>
                <div className ={style.userpage}>
                    <div>姓名：</div> <div>{this.state.username}</div>
                    <div>性别：</div> <div>{this.state.sex}</div>
                    <div>手机号：</div> <div>{this.state.phonenumber}</div>
                </div>
                
            </div>
        );
    }
    
}
